import { SIGNIN } from '../actions/types';

const usersReducer = (state = { email: '' }, action) => {
  switch (action.type) {
    case SIGNIN:
      console.log('signin working in usersReducer');
      return {
        ...state,
      };
    default:
      return state;
  }
};
export default usersReducer;
